import React, { FunctionComponent } from 'react';
import SKINS from '../models/mock-skins';
import SkinsListInput from '../components/skin-list';

const skinsList: FunctionComponent = () => {

    return (

        <div>
            <SkinsListInput SkinsIn={SKINS} DomClass={"all-skin"}/>
        </div>
    );
}

export default skinsList;
